import React, { Component } from 'react'
import "../../Css/Dashboard.css";
import { showAllProject } from '../../actions/projectAction.js'
import { connect } from 'react-redux';
import PropTypes from 'prop-types';



 class Dashboard extends Component {

    
    componentDidMount(){
        this.props.showAllProject();
    }
  componentWillReceiveProps(nextProps){
            if(nextProps.errors){
                this.setState({
                    project: nextProps.project
                });
            }
     }
    render() {
        return (
            <div className="dashboard">
                <div className="navName">
                    <h4>Dashboard</h4>
                    <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Quos, quaerat eaque. Harum sunt explicabo quam minima veniam possimus odit officiis?</p>
                </div>
                <hr/>
                <div className="dashBoard_body">
                    
                </div>
            </div>
        )
    }
}
Dashboard.propTypes = {
  showAllProject: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  project: PropTypes.object.isRequired
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  project: state.project
});
export default connect(mapStateToProps, {  showAllProject })(Dashboard);
